            CV: "",
            permisConduire: "",
            assuranceAutomobile: "",
            photo: "",
            RIB: "",


        };
    }
    onChangeUndler = (e) => {
        this.setState({
            carnetVaccination: e.target.files,
            CV: e.target.files,
        });

    };


    render() {
        console.log('state', this.state);

        return (
            <div>
                CarnetVaccination<input type="file" name="file" onChange={this.onChangeUndler} />
                CV<input type="file" name="file" onChange={this.onChangeUndler} />
